static void _xbCallback(WM_MESSAGE * pMsg) {
  int Sel, NCode, Id;
  WM_HWIN hItem;
  GUI_PID_STATE * pState;
  switch (pMsg->MsgId) {
    case WM_INIT_DIALOG:
      break;
    case WM_KEY:
      switch (((WM_KEY_INFO*)(pMsg->Data.p))->Key) {
        case GUI_KEY_ESCAPE:
          GUI_EndDialog(pMsg->hWin, 1);
          break;
        case GUI_KEY_ENTER:
          GUI_EndDialog(pMsg->hWin, 0);
          break;
      }
      break;
    case WM_TOUCH_CHILD:
      Id = WM_GetId(pMsg->hWinSrc);
      switch (Id) {
        case GUI_ID_TEXT0:
        case GUI_ID_TEXT1:
        case GUI_ID_TEXT2:
          pState = (GUI_PID_STATE *)((WM_MESSAGE *)pMsg->Data.p)->Data.p;
          if (pState) {
            if (pState->Pressed) {
              WM_HWIN hRadio = WM_GetDialogItem(pMsg->hWin, GUI_ID_RADIO0);
              RADIO_SetValue(hRadio, Id - GUI_ID_TEXT0);
            }
          }
          break;
      }
      break;
    case WM_NOTIFY_PARENT:
      Id    = WM_GetId(pMsg->hWinSrc);
      NCode = pMsg->Data.v;
      switch (NCode) {
        case WM_NOTIFICATION_RELEASED:
          switch (Id) {
            case GUI_ID_OK:
              GUI_EndDialog(pMsg->hWin, 0);
              break;
          }
          break;
        case WM_NOTIFICATION_VALUE_CHANGED:
          hItem = WM_GetDialogItem(pMsg->hWin, GUI_ID_RADIO0);
          Sel   = RADIO_GetValue(hItem);
          gamePlay.setMode(Sel);
          break;
      }
      break;
    default:
      WM_DefaultProc(pMsg);
  }
}


static void _zbBkWindow(WM_MESSAGE* pMsg) {
  switch (pMsg->MsgId) {
  case WM_PAINT:
    GUI_SetBkColor(GUI_RED);
    GUI_Clear();
    GUI_SetColor(GUI_WHITE);
    GUI_SetFont(&GUI_Font24_ASCII);
    GUI_DispStringHCenterAt("TIC TAC TOE", 160, 70);
    GUI_DispStringHCenterAt("GAME STARTING", 160, 130);
    break;
  default:
    WM_DefaultProc(pMsg);
  }
}


void makeMove(int x, WM_MESSAGE * pMsg ){
     int myMove=gamePlay.move(x);
     switch (myMove) {
     case 1:
    	 BUTTON_SetText(WM_GetDialogItem(pMsg->hWin, ID_BUTTON_0+x),"X");
    	 WM_HideWin(WM_GetDialogItem(pMsg->hWin, ID_IMAGE_0));
    	 WM_ShowWin(WM_GetDialogItem(pMsg->hWin, ID_IMAGE_1));
    	 break;
     case -1:
    	 BUTTON_SetText(WM_GetDialogItem(pMsg->hWin, ID_BUTTON_0+x),"0");
    	 WM_HideWin(WM_GetDialogItem(pMsg->hWin, ID_IMAGE_1));
    	 WM_ShowWin(WM_GetDialogItem(pMsg->hWin, ID_IMAGE_0));
         break;
     case -100:
    	 TEXT_SetText(WM_GetDialogItem(pMsg->hWin, ID_TEXT_1), "Draw!");
    	 BUTTON_SetText(WM_GetDialogItem(pMsg->hWin, ID_BUTTON_0+x),"X");
    	 WM_HideWin(WM_GetDialogItem(pMsg->hWin, ID_IMAGE_0));
    	 WM_HideWin(WM_GetDialogItem(pMsg->hWin, ID_IMAGE_1));
         break;
     case 100:
         TEXT_SetText(WM_GetDialogItem(pMsg->hWin, ID_TEXT_1), "Draw!");
         BUTTON_SetText(WM_GetDialogItem(pMsg->hWin, ID_BUTTON_0+x),"0");
         WM_HideWin(WM_GetDialogItem(pMsg->hWin, ID_IMAGE_0));
         WM_HideWin(WM_GetDialogItem(pMsg->hWin, ID_IMAGE_1));
         break;
     case -10:
    	 BUTTON_SetText(WM_GetDialogItem(pMsg->hWin, ID_BUTTON_0+x),"X");
    	 TEXT_SetTextColor(WM_GetDialogItem(pMsg->hWin, ID_TEXT_1), GUI_RED);
    	 TEXT_SetText(WM_GetDialogItem(pMsg->hWin, ID_TEXT_1), "You win!");
    	 WM_HideWin(WM_GetDialogItem(pMsg->hWin, ID_IMAGE_1));
    	 WM_ShowWin(WM_GetDialogItem(pMsg->hWin, ID_IMAGE_0));
         break;
     case 10:
         TEXT_SetText(WM_GetDialogItem(pMsg->hWin, ID_TEXT_1), "You win!");
         BUTTON_SetText(WM_GetDialogItem(pMsg->hWin, ID_BUTTON_0+x),"0");
         TEXT_SetTextColor(WM_GetDialogItem(pMsg->hWin, ID_TEXT_1), GUI_RED);
         WM_HideWin(WM_GetDialogItem(pMsg->hWin, ID_IMAGE_0));
         WM_ShowWin(WM_GetDialogItem(pMsg->hWin, ID_IMAGE_1));
         break;
   }
}


static const void * _GetImageById(U32 Id, U32 * pSize) {
  switch (Id) {
  case ID_IMAGE_0_IMAGE_0:
    *pSize = sizeof(_acImage_0);
    return (const void *)_acImage_0;
  case ID_IMAGE_1_IMAGE_0:
    *pSize = sizeof(_acImage_1);
    return (const void *)_acImage_1;
  }
  return NULL;
}


